import React from 'react'

const TodoForm = () => {
	const handleSubmit = (e) => {
		e.prevent.default()
	}

	return (
		<form onSubmit={handleSubmit}>
			<input type="text" required />
			<input type="submit" value="add todo" />
		</form>
	)
}

export default TodoForm
